            background-repeat: no-repeat;
            background-size: 100% 100%;
            position: absolute;
            left: 10vw;
            top: 85%;
            animation: scale 1s linear infinite;
        }
        @keyframes scale {
            from {
                transform: scale(1);
            }
            25% {
                transform: scale(0.95);
            }
            50% {
                transform: scale(1);
            }
            75% {
                transform: scale(1.05);
            }
            100% {
                transform: scale(1);
            }
        }
        @keyframes move-hand {
            from {
                left: 0;
            }
            25% {
                left: -35vw;
            }
            50% {
                left: 0;
            }
            75% {
                left: 35vw;
            }
            100% {
                left: 0;
            }
        }
        @keyframes move-rod {
            from {
                left: -0.5%;
            }
            25% {
                left: -35vw;
            }
            50% {
                left: 0;
            }
            75% {
                left: 35vw;
            }
            100% {
                left: -0.5%;
            }
        }
        #mask {
            width: 100%;
            height: 100%;
            position: absolute;
            left: 0;
            top: 0;
            background: #000;
            opacity: 0.7;
            z-index: 5;
            display: none;
        }

            height: 80vw;

            top: 50%;

            overflow: hidden;
            display: none;
        }

            body {

            #hand {
                width: 14.5vh;
                height: 16.8vh;
                position: relative;
                top: 18.1%;
                left: 0%;
            }
            @keyframes move-hand {
                from {
                    left: 0;
                }
                25% {
                    left: -12vw;
                }
                50% {
                    left: 0;
                }
                75% {
                    left: 12vw;
                }
                100% {
                    left: 0;
                }
            }
            @keyframes move-rod {
                from {
                    left: -0.5%;
                }
                25% {
                    left: -12vw;
                }
                50% {
                    left: 0;
                }
                75% {
                    left: 12vw;
                }
                100% {
                    left: -0.5%;

                    $("#item13").animate({
                        "top": top1
                    }, 500, "linear", function() {
                        $("#item13").css({
                            "display": "none",
                            "top": top2
                        });
                        $("#reward").show();
                        $("#mask").show();
                        loadAnim();

                        setTimeout(function () {
                            $("#reward").children().remove();
                            $("#reward").hide();
                            $("#mask").hide();
                            if(source>200){
                                source=200;
                            }
                            $("#money").text("$" + source);
                            if (source > 100) {
                                $("#mask").show();
                                $("#end").fadeIn(1000);
                            }
                        }, 3000)
                    })
                }

                // 杆返回
                $("#rod").animate({
                    height: "3px"
                }, 500, "linear", function () {
                    //当动画结束的时候，将爪子松开
                    $("#hand").css({
                        "background-image": "url("+data.hand1+")",
                        "background-repeat": "no-repeat",
                        "background-size": "100%",
                    });
                    $("#hand").css({
                        "animation-play-state": "running"
                    })
                    $("#rod").css({
                        "animation-play-state": "running"
                    })
                    flag = true; //等绳子升上去又可以点击了
                    //弹出奖励。

                });
            },500)
        }

        function checkReady() {
            if (mraid) {
                mraid.setOrientationProperties({
                    "allowOrientationChange": true
                });
                var maxSize = mraid.getMaxSize();
                if (maxSize) {
                    console.log("")
                }
            }
            if (mraid.getState() == 'loading') {
                mraid.addEventListener("ready", mraidIsReady);
            } else if (mraid.getState() == "ready") {
                mraidIsReady();
            }
        }

        function mraidIsReady() {
            mraid.addEventListener('viewableChange', function () {
                console.log("viewable changed");
            });
            if (mraid.isViewable()) {}
        }

        checkReady();

        $("#reward").click(function(){
            openStore();
        });
        $("#end").click(function(){
            openStore();
        });
        function openStore(){
            if (getClientInfo() == "iOS") {
                mraid.open("")
            } else if(getClientInfo() == "Android"){
                mraid.open("")
            }
